import GasZTRPrice from "../inputs/GasZTRPrice";

const Step2 = ({ whichStep, setWhichStep, customerInputs, handleChange }) => {
  return (
    <>
      <h1>Step2</h1>
      <li className="column range with-output">
        <GasZTRPrice {...{ customerInputs, handleChange }} />
      </li>{" "}
      <Button {...{ whichStep, setWhichStep }} />
    </>
  );
};

export default Step2;
